import {FETCH_TREE} from './constant';

export const fetchTree = (tree) => {
    return ({
        type : FETCH_TREE,
        payload : tree
    })
  };

export const addNode = (node)=>{
    return ({
        type : ADD_NODE,
        payload : node
    })
}
